class Country extends Component {
  state = {list: initialCountriesList}

  onVisit = id => {
    const {list} = this.state
    const visit = list.map(each => {
      if (each.id === id) {
        const updateList = {...each, isVisited: !each.isVisited}
        return updateList
      }
      return each
    })
    this.setState({list: visit})
  }

  remove = id => {
    const {list} = this.state
    const removed = list.map(each => {
      if (each.id === id) {
        const updateList = {...each, isVisited: !each.isVisited}
        return updateList
      }
      return each
    })
    this.setState({list: removed})
  }

  render() {
    const {list} = this.state
    const updateList = list.filter(country => country.isVisited === true)
    return (
      <BgContainer>
        <Heading>Countries</Heading>
        <UlContainer>
          {list.map(each => (
            <CountryItem
              key={each.id}
              countryItem={each}
              onVisit={this.onVisit}
            />
          ))}
        </UlContainer>
        <JustCon>
          <Heading>Visited Countries</Heading>
          {updateList.length > 0 && <VisitBtn>{updateList.length}</VisitBtn>}
        </JustCon>
        {updateList.length === 0 ? (
          <Para>No Countries Visited yet!</Para>
        ) : (
          <UlCon>
            {updateList.map(each => (
              <CountriesMap key={each.id} map={each} remove={this.remove} />
            ))}
          </UlCon>
        )}
      </BgContainer>
    )
  }
}

export default Country
